import React from "react";
import { useRef } from "react";
import { useState } from "react";
import { useEffect } from "react";
import '../css/Home.css'
import '../css/product.css'
import axios from 'axios';

function Product() {
    const [products, setProducts] = useState([]);
    const hiddenItemsRef = useRef([]);

    useEffect(() => {
        // Gọi API để lấy dữ liệu sản phẩm
        axios.get('https://localhost:7256/api/Sanpham')
            .then(response => {
                setProducts(response.data); // Lưu dữ liệu vào state
            })
            .catch(error => {
                console.error("Lỗi khi lấy dữ liệu sản phẩm:", error);
            });
    }, []);

    const showMore = () => {
        hiddenItemsRef.current.forEach(item => {
            if (item) item.classList.remove('hidden');
        });
        document.getElementById('Show').style.display = 'none';
    };

    return (
        <div className="container-fluid">
            <div className="row">
                <h1 className="mb-5">Bộ sưu tập</h1>
                {products.map((product, index) => (
                    <div 
                        key={product.productId} 
                        className={`col-md-3 ${index >= 8 ? 'hidden' : ''}`} 
                        ref={el => hiddenItemsRef.current[index - 8] = el}
                    >
                        <div className="product-image">
                            <img 
                                className="card-img-top" 
                                src={product.imageUrl || "https://i.ebayimg.com/images/g/HDEAAOSwArFc9qBa/s-l400.jpg"} 
                                alt={product.productName} 
                            />
                            <div className="card-body">
                                <h5 className="card-title">{product.productName}</h5>
                                <p className="card-text">{product.gia} VND</p>
                                <button className="btn btn-primary buy-now">Mua Ngay</button>
                            </div>
                        </div>
                    </div>
                ))}
                <button id="Show" onClick={showMore} className="mt-3 btn btn-primary mx-auto d-block">Show more</button>
            </div>
        <div className="contact">
            <div className="thongtin">
                <h1>
                    Thong tin
                </h1>
                <p>
                Cơ sở : 331/7/52 Phan huy ích
                </p>
                <p>
                TPHCM: so dien thoai 0335552225
                </p>
                <p>
                Email: t2ngvn@gmail.com
                </p>
                
            </div>
            <div className="gioithieu">
                <h1>
                Menu
                </h1>
                <p>Sản phẩm</p>
                <p>Về chúng tôi</p>
                <p>Giấy phép và điều khoản</p>
            </div>
            <div className="taikhoan">
                <h1>
                Tài khoản
                </h1>
                <p>Tài khoản của bạn</p>
                <p>Kiểm tra tài khoản</p>
                <p>Giỏ hàng của bạn</p>
                <p>Đơn hàng cảu bạn</p>
            </div>
            <div className="lienhe">
                <h1>
                Liên hệ
                </h1>
                <p>Facebook</p>
                <p>Instagram</p>
                <p>Twitter</p>
            </div>

            <div className="phanhoi">
                <h1>phan hoi</h1>
                <input className='phanhoi1' type="text" placeholder="nhap email cua ban"></input>
                <button id="gui">Gửi</button>
            </div>
        </div>
    </div>

        
    );
}
export default Product;
